function Choice({classname,content}:{classname:string,content:string}) {
  function handleClick() {
    console.log('choice' + content + 'is clicked>~<');
  }
  return (
    <div className={classname}>
      <h2 onClick={handleClick}>{content}</h2>
    </div>
  )
}

